public Header[] getAll(String name) {
	List<Header> l = null;
	for (int i = 0; i < entries.length; i++) {
		Header x = entries[i];
		if (eq(x.getName(), name)) {
			if (l == null)
				l = new ArrayList<>();
			l.add(x);
		}
	}
	return l == null ? EMPTY_ARRAY : l.toArray(new Header[l.size()]);
}

